import { FaLinkedin, FaEnvelope, FaPhone } from "react-icons/fa";
import "./Header.css";
import { motion } from "framer-motion";

function Header() {
  return (
    <motion.header
      initial={{ opacity: 0, y: -20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
      className="header-container"
    >
      <h1 className="headline">HELLO, I'M A FULL-STACK DEVELOPER.</h1>
      <p className="subheadline">I build web applications.</p>
      <div className="icon-links">
        <a
          href="https://www.linkedin.com/in/roopesh-srinivasa-34791015b"
          target="_blank"
          rel="noreferrer"
        >
          <FaLinkedin className="icon linkedin" />
        </a>
        <a href="mailto:roopeshmahi.7@gmail.com">
          <FaEnvelope className="icon email" />
        </a>
        <a href="tel:+919036629114">
          <FaPhone className="icon phone" />
        </a>
      </div>
    </motion.header>
  );
}

export default Header;
